class MedianFinder {

    PriorityQueue<Integer> minPq = new PriorityQueue<>(); // 
    PriorityQueue<Integer> maxPq = new PriorityQueue<>(Comparator.reverseOrder()); // , minPq   minPq.size()+1

    /**
     * initialize your data structure here.
     */
    public MedianFinder() {

    }

    public void addNum(int num) {
        if (maxPq.isEmpty()) {
            maxPq.offer(num);
        } else {
            if (num > maxPq.peek()) {
                minPq.offer(num);
            } else {
                maxPq.offer(num);
            }
        }

        // 
        while (minPq.size() < maxPq.size()) {
            minPq.offer(maxPq.poll());
        }
        while (minPq.size() > maxPq.size()) {
            maxPq.offer(minPq.poll());
        }
    }

    public double findMedian() {
        if (minPq.size() == maxPq.size()) {
            return (minPq.peek() + maxPq.peek()) / 2d;
        }
        return maxPq.peek() + 0d;
    }
}

class DisjointSetUnion {
    Map<Integer, Integer> parent = new HashMap<>();

    public boolean add(int i) {
        if (parent.containsKey(i)) return false;
        parent.put(i, i);
        return true;
    }

    public int find(int i) {
        int cur = i;
        while (parent.get(cur) != cur) {
            cur = parent.get(cur);
        }
        int finalParent = cur;
        cur = i;
        while (parent.get(cur) != finalParent) { // 
            int origCur = cur;
            parent.put(cur, finalParent);
            cur = parent.get(origCur);
        }
        return finalParent;
    }

    public boolean merge(int i, int j) {
        int iParent = find(i), jParent = find(j);
        if (iParent == jParent) return false;
        parent.put(iParent, jParent);
        return true;
    }

    public boolean isConnect(int i, int j) {
        return find(i) == find(j);
    }


}

